let read=(id)=>{
    return document.getElementById(id).value
 }
 let creat=(id)=>{
     return document.createElement(id);
 }
 let get=(id)=>{
 return document.getElementById(id);
 
 }

function orderfood(){
    let id,url;
    let order1 = get("burger");
    if(order1.checked){
        id="order NO.1 Burger is ready" 
        url="data:image/jpeg;base64,"
        order(id,url)
    }
    let order2 = get("icecream");
    if(order2.checked){
        id="iceream is Ready NO.22"
        url="data:image/jpeg;base64,"
        order(id,url)
    }
    let order3 = get("sandwich");
    if(order3.checked){
        id="No.33 Sandwich is ready";
        url="data:image/jpeg;base64,"
        order(id,url)
    }
    let order4 = get("fries");
    if(order4.checked){
        id="Order No.44 French fries is ready";
        url="data:image/jpeg;base64,"
        order(id,url)
    }
    let order5 = get("coldDrinks");
    if(order5.checked){
        id="Order No.555 Coldrink is ready";
        url="data:image/jpeg;base64,"
        order(id,url);
    }
    let order6=get("pasta");
    if(order6.checked){
        id="Order No.666 Pasta is ready"
        url="data:image/jpeg;base64,"
        order(id,url);
    }

    function order(od,url){
        let status ="open";
        let mypromise= new Promise(function(resolve,reject){
            let time = Math.random()*10*1000;
            setTimeout(function(){
                if(status=="open"){
                    resolve(od);
                }
                else{
                    reject ();
                }
            },time)
        })



        mypromise.then(function (od){
            get("screen").innerHTML=null;
            let div1 =creat("div")
            div1.id="box"
            let img = creat("img");
            img.src=url;
            img.style.height="300px"
            img.style.width="300px"
            let p = creat("p");
            p.innerText=od;
            div1.append(img,p);
          
            get("screen").append(div1)
        })
    }



}